import React from 'react'
import FooterComponent from './footer/FooterComponent'
import Navbar from '../components/Navbar/Navbar'
import MainComponent from './main/MainComponent'

const LayoutPage = () => {
  return (
    <div>
        <Navbar/>
        <MainComponent/>
        <FooterComponent/>
    </div>
  )
}

export default LayoutPage;
